import React from 'react';
import './styles.css';

function Images(props) {
    return (
        <div>
            <div className="card">
                <div value={props.id} onClick={() => props.imageClick(props.id)}>
                    <div className="img-container" >
                        <img alt={props.name} src={props.image} />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Images
